import React, {Component} from "react";
import './App.css';


class App extends Component {
  constructor(){
    super();
    this.state = {
      weather: [],
    }// end constructor
  }


  componentDidMount(){
    fetch("https://api.openweathermap.org/data/2.5/weather?q=alameda&appid=5641904b9f9d3a2b1751db682fa354ff")
    .then((response) => response.json())
    .then(users => this.setState({weather: users}));


  }


  render(){
    return(
      <div className="App">  
        {this.state.weather.map( weatherOBJ => ( <h1 key={weatherOBJ.sys.id}> {weatherOBJ.main}</h1>))}
       <div> Hello World To The Dee</div>
      </div>
    );

  }





}// End Class





export default App;
